window.bookSummaryJSON = "<p>For 1,000 years, being born with magic was a death sentence. Hart and his twin have survived by hiding who they truly were until their time came. </p> <p>It started as a whisper, rumors, but when they find out there truly is a mage uprising, they join the fight, tilting the balance in the mages’ favor.</p> <p>The era of magicless mortals has passed in their multiplanetary kingdom. A war has started, and the mages will win it. </p> <p>Hart has lived and breathed for liberating their kind, thinking of nothing else, until Dara. </p> <p>When Dara’s deluded father imprisons Kai Lor Hora’s ambassador, she knows there will be reprisals. Her world stands at the brink of destruction. She has no love for mages, but trying to help this one escape might just save her family. </p> <p>They’re two mortal enemies who should never have met and can never go back to a simpler time. </p> <p>Warning: Strands of Starfire is a space fantasy romance series, and each audiobook includes some explicit scenes.</p> <p>Note that this series will only include stand-alone audiobooks.</p>"; 
